London-based menswear designer Martine Rose has partnered with streetwear imprint Been Trill once again for a new footwear silhouette.
<!--more-->A hiking boot in style, the model features a light cream-colored, soft leather upper with beige leather lining, quick-lace metallic silver eyelets, pink ribbon laces, and a white rubber sole. The boot also comes with a removable tan brown strap etched with “#Martine Rose#.” You can purchase the Martine Rose x Been Trill hiking boot now from Storm Copenhagen for approximately $756 USD.
